import React, {useState} from 'react';
import Container from './components/Container.js'
import BackgroundImage from './components/BackgroundImage.js'
import BigText from './components/BigText.js'
import Navbar from './components/Navbar.js'
import Card from './components/Card.js'
import Button from './components/Button.js'
import bg from './bg.jpg'
import bg2 from './bg2.jpg'
import styled from 'styled-components';
import portalX_badge from './portalX_badge.png'

const Style = styled.div`
  user-select: none;



  .infoSection {
    display: flex; flex-direction: row;
    flex-wrap: wrap;
    font-size: 1rem;

    align-items: center;
    justify-content: center;
    .infoPart {
      h1 {
        color: #444;
      }
      width: 200px;
      padding: 5px;
      margin-top: 10px;
      margin-bottom: 30px;
      margin-left: 100px; margin-right: 100px;      
      border-bottom: 4px solid #47FFC4;
    }

    .infoPart:hover {
      border-color: #363636;
    }
  }
`;

function App() {
  const [infoToShow, setInfo] = useState('experience');



  return (
    <Style className="App">
      <Navbar>
        <img src={portalX_badge}/>
        <h1>LunaPortal<span className='blue'>X</span></h1>

        <Button>contact</Button>
      </Navbar>

      <Container height='81vh'>
        <BackgroundImage bg={bg2} fixed='true'>
          <BigText align='center' fontsize='3rem'>
            welcome to <br/> LunaPortalX
          </BigText>          
        </BackgroundImage>
      </Container>

      <Container>
        <div className='infoSection'>
          <div className='infoPart' href='#info' onClick={()=>{setInfo('experience')}}
            onMouseOver={()=>{setInfo('experience')}}>
            <h1>Experience</h1>
            <p>space like never before.</p>
          </div>
          <div className='infoPart' onClick={()=>{setInfo('explore')}}
            onMouseOver={()=>{setInfo('explore')}}>
            <h1>Explore</h1>
            <p>parts of the solar system still
              unknown.</p>
          </div>
          <div className='infoPart' onClick={()=>{setInfo('discover')}}
            onMouseOver={()=>{setInfo('discover')}}>
            <h1>Discover</h1>
            <p>New worlds, people, and technology.</p>
          </div>
        </div>
      </Container>

      <Container height='100vh' bg='#111' id='#info'>


          {infoToShow === 'experience' ? 
            <div>
              <BigText align='center' fontsize='3rem'>Experience</BigText>
              <Card align='left'>
                <div className='row'><h1>LunaPortal Trip Information</h1></div>
                <div className='row'>
                  <h2>worlds: </h2><h3>Moon, Mars, Encellidus, Europa, Saturn.</h3>
                </div>
                <div className='row'>
                <h2>duration:</h2><h3>3 years</h3>
                </div>
                <div className='row'>
                <h2>departure: </h2><h3>2030</h3>
                </div>
                <div className='row'>
                <h2>transfers: </h2><h3>Orbital, Gateway, MarsX, SaturnLine</h3>
                </div>
              </Card>
              <Card align='center'>
                <div className='row'><h1>Why Lunaportal?</h1></div>
                <div className='row'>
                <h2></h2><h3>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. In fermentum et sollicitudin ac. At quis risus sed vulputate odio ut enim blandit volutpat. Viverra justo nec ultrices dui sapien eget. Sodales ut etiam sit amet nisl purus in mollis nunc. Pharetra massa massa ultricies mi quis hendrerit dolor magna. Duis convallis convallis tellus id interdum velit laoreet. Velit aliquet sagittis id consectetur purus ut faucibus. Facilisi morbi tempus iaculis urna. Massa eget egestas purus viverra. Adipiscing enim eu turpis egestas. Luctus venenatis lectus magna fringilla. Convallis a cras semper auctor neque. Porta nibh venenatis cras sed felis eget velit aliquet. Tellus rutrum tellus pellentesque eu tincidunt tortor aliquam nulla. Nibh venenatis cras sed felis eget velit aliquet sagittis. Orci a scelerisque purus semper eget. Nunc consequat interdum varius sit amet mattis vulputate enim. Sed tempus urna et pharetra pharetra massa.</h3>
                </div>
              </Card>
            </div>            
          : infoToShow === 'explore' ?
            'explore'
            : infoToShow === 'discover' ?
            'discover'
            :
            'none'
            }
      </Container>
    </Style>
  );
}

export default App;
